import styled from 'styled-components';

export const Button = styled.button`
  background-color: #2ebd59;
  border: none;
  border-radius: 500px;
  color: #fff;
  cursor: pointer;
  font-size: 14px;
  height: 43px;
  margin-top: 16px;
  outline: none;
  padding: 13px 44px;
  width: 130px;
`;
